import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import axios from 'axios';
import { useAuthStore } from '../store/authStore';

const ModalContainer = styled.div`
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background-color: #121212;
  padding: 20px;
  border-radius: 16px;
  border: 1px solid #333; // Borda cinza suave
  box-shadow: 0 4px 10px rgba(0, 0, 0, 0.3);
  width: 400px;
  z-index: 1000;
`;

const ModalHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const ModalTitle = styled.h2`
  color: #fff;
  font-size: 1.5em; // Tamanho da fonte ajustado
`;

const CloseButton = styled.button`
  background: none;
  border: none;
  color: #fff;
  cursor: pointer;
  font-size: 1.5em; // Tamanho da fonte ajustado
`;

const InputGroup = styled.div`
  margin-bottom: 15px;
  display: flex;
  flex-direction: column;
  align-items: center; // Centralizar inputs
`;

const Label = styled.label`
  display: block;
  color: #fff;
  margin-bottom: 5px;
`;

const Input = styled.input`
  width: 80%; // Menor largura
  padding: 10px;
  border-radius: 8px;
  border: 1px solid #555; // Borda cinza
  background-color: #333;
  color: #fff;
  margin-bottom: 10px;
  text-align: center; // Alinhar texto ao centro
`;

const ActionButton = styled.button<{ variant?: string }>`
  width: 48%; // Ajustar largura para botões menores
  padding: 10px;
  border: none;
  border-radius: 8px;
  cursor: pointer;
  background-color: ${props => props.variant === 'delete' ? '#d9534f' : '#5CB85C'};
  color: #fff;
  font-size: 0.9em; // Tamanho da fonte ajustado
  margin: 5px;
  &:hover {
    opacity: 0.8;
  }
`;

const SaveButton = styled(ActionButton)`
  background-color: #fff;
  color: #333;
  position: absolute;
  bottom: 10px;
  right: 10px;
`;

const ProfileModal: React.FC<{ onClose: () => void; closeTab: () => void }> = ({ onClose, closeTab }) => {
  const [userInfo, setUserInfo] = useState<{ name: string; email: string } | null>(null);
  const userId = useAuthStore((state) => state.userId);

  useEffect(() => {
    closeTab(); // Fechar a abinha ao abrir o modal

    const fetchUserInfo = async () => {
      if (!userId) {
        return;
      }

      try {
        const response = await axios.get(`http://localhost:5002/api/users/${userId}`);
        setUserInfo(response.data);
      } catch (error) {
        alert('Erro ao carregar informações do usuário.');
      }
    };

    fetchUserInfo();
  }, [userId, closeTab]);

  const handleUpdate = async () => {
    if (userInfo && userId) {
      try {
        await axios.put(`http://localhost:5002/api/users/${userId}`, userInfo);
        alert('Usuário atualizado com sucesso');
      } catch (error) {
        alert('Erro ao atualizar usuário.');
      }
    }
  };

  const handleDelete = async () => {
    if (userId) {
      try {
        await axios.delete(`http://localhost:5002/api/users/${userId}`);
        alert('Usuário deletado com sucesso');
        onClose(); // Fechar o modal após exclusão
      } catch (error) {
        alert('Erro ao excluir usuário.');
      }
    }
  };

  if (!userInfo) return null;

  return (
    <ModalContainer>
      <ModalHeader>
        <ModalTitle>Seu Perfil</ModalTitle>
        <CloseButton onClick={onClose}>×</CloseButton>
      </ModalHeader>
      <InputGroup>
        <Label>Nome</Label>
        <Input
          value={userInfo.name}
          onChange={(e) => setUserInfo((prev) => prev ? { ...prev, name: e.target.value } : prev)}
        />
      </InputGroup>
      <InputGroup>
        <Label>E-mail</Label>
        <Input
          value={userInfo.email}
          onChange={(e) => setUserInfo((prev) => prev ? { ...prev, email: e.target.value } : prev)}
          readOnly // E-mail travado
        />
      </InputGroup>
      <ActionButton onClick={handleDelete} variant="delete">Deletar</ActionButton>
      <SaveButton onClick={handleUpdate}>Salvar alterações</SaveButton>
    </ModalContainer>
  );
};

export default ProfileModal;
